$('#append').on('click', function() {
    infinite2.append([{
        'column1': 'append',
        'column2': 'append',
        'column3': 'append',
        'column4': 'append',
        'column5': 'append'
    },{
            'column1': 'append',
            'column2': 'append',
            'column3': 'append',
            'column4': 'append',
            'column5': 'append'
    }]);
});
$('#prepend').on('click', function() {
    infinite2.prepend([{
        'column1': 'prepend',
        'column2': 'prepend',
        'column3': 'prepend',
        'column4': 'prepend',
        'column5': 'prepend'
    },{
        'column1': 'prepend',
        'column2': 'prepend',
        'column3': 'prepend',
        'column4': 'prepend',
        'column5': 'prepend'
    }]);
});

$('#clear').on('click', function() {
    infinite2.clear();
});



infinite2.on('click', function(customEvent) {
    if (customEvent.$target.hasClass('test_click')) {
        alert('remove: ' + customEvent.$target.val());
        infinite2.remove(customEvent.rowKey);
    }
});

